import React from 'react';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom"

import './App.css';
import Login from './route/Login.js';


function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path={"/admin/login"} component={Login} />

        </Switch>
        <div id='footerDistance'></div>
      </Router>

    </div>
  );
}

export default App;
